DROP TABLE `users`;
CREATE TABLE `users` (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    `userKey` TEXT,
    `title` TEXT,
    `first_name` TEXT,
    `middle_name` TEXT,
    `last_name` TEXT,
    `name_suffix` TEXT,
    `phone` TEXT,
    `email` TEXT,
    `socMedia` TEXT,
    `streetAddress` TEXT,
    `buildingName` TEXT,
    `floor` TEXT,
    `roomAptCondoFlat` TEXT,
    `city` TEXT,
    `stateProvince` TEXT,
    `locality` TEXT,
    `country` TEXT,
    `postalCode` TEXT,
    `latitude` REAL,
    `longitude` REAL,
    `username` TEXT,
    `oauth2` TEXT,
    `password` TEXT,
    `gender` TEXT,
    `dateOfBirth` TEXT,
    `partner` TEXT,
);
